import React, { useEffect } from 'react';
import { View, Text, StyleSheet, Animated, Easing } from 'react-native';

const NeutronAnimation = () => {
  const outerCircleRotate = new Animated.Value(0);
  const secondCircleRotate = new Animated.Value(0);
  const innerCircleRotate = new Animated.Value(0);

  useEffect(() => {
    const outerAnimation = Animated.timing(outerCircleRotate, {
      toValue: 1,
      duration: 4000,
      easing: Easing.linear,
      useNativeDriver: true,
    });
    const secondAnimation = Animated.timing(secondCircleRotate, {
      toValue: 1,
      duration: 5000,
      easing: Easing.linear,
      useNativeDriver: true,
    });
    const innerAnimation = Animated.timing(innerCircleRotate, {
      toValue: 1,
      duration: 6000,
      easing: Easing.linear,
      useNativeDriver: true,
    });

    const resetAnimation = Animated.timing(outerCircleRotate, {
      toValue: 0,
      duration: 0,
      useNativeDriver: true,
    });

    const sequence = Animated.sequence([
      outerAnimation,
      resetAnimation,
      secondAnimation,
      resetAnimation,
      innerAnimation,
      resetAnimation,
    ]);

    Animated.loop(sequence).start();
  }, []);

  const outerCircleRotation = outerCircleRotate.interpolate({
    inputRange: [0, 1],
    outputRange: ['0deg', '360deg'],
  });

  const secondCircleRotation = secondCircleRotate.interpolate({
    inputRange: [0, 1],
    outputRange: ['0deg', '360deg'],
  });

  const innerCircleRotation = innerCircleRotate.interpolate({
    inputRange: [0, 1],
    outputRange: ['0deg', '360deg'],
  });

  return (
    <View style={styles.container}>
      <View style={styles.nucleus}>
        <View style={styles.row}>
          <View style={[styles.proton, { backgroundColor: 'red' }]}></View>
          <View style={[styles.proton, { backgroundColor: 'red' }]}></View>
          <View style={[styles.neutron, { backgroundColor: 'blue' }]}></View>
          <View style={[styles.neutron, { backgroundColor: 'blue' }]}></View>
        </View>
        <View style={styles.row}>
          <View style={[styles.neutron, { backgroundColor: 'blue' }]}></View>
          <View style={[styles.neutron, { backgroundColor: 'blue' }]}></View>
          <View style={[styles.proton, { backgroundColor: 'red' }]}></View>
          <View style={[styles.proton, { backgroundColor: 'red' }]}></View>
        </View>
      </View>
      <Animated.View style={[styles.circle, { transform: [{ rotate: outerCircleRotation }] }]}></Animated.View>
      <Animated.View style={[styles.circle, styles.secondCircle, { transform: [{ rotate: secondCircleRotation }] }]}></Animated.View>
      <Animated.View style={[styles.circle, styles.innerCircle, { transform: [{ rotate: innerCircleRotation }] }]}></Animated.View>
      <View style={styles.footer}>
        <Text style={styles.neutronWording}>Here are neutrons.</Text>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#121212',
    alignItems: 'center',
    justifyContent: 'center',
    perspective: 100,
  },
  nucleus: {
    width: 50,
    height: 50,
    flexDirection: 'row',
    transformStyle: 'preserve-3d',
  },
  row: {
    flex: 1,
    justifyContent: 'space-around',
    alignItems: 'center',
    transform: [{ rotateX: '80deg' }, { rotateY: '180deg' }],
  },
  proton: {
    width: 10,
    height: 10,
    borderRadius: 5,
  },
  neutron: {
    width: 10,
    height: 10,
    borderRadius: 5,
  },
  circle: {
    width: 30,
    height: 30,
    borderRadius: 15,
    borderWidth: 2,
    borderColor: '#ccc',
    position: 'absolute',
  },
  secondCircle: {
    width: 22,
    height: 22,
    borderWidth: 2,
    borderColor: '#ccc',
    top: 40,
    left: 40,
  },
  innerCircle: {
    width: 14,
    height: 14,
    borderWidth: 2,
    borderColor: '#ccc',
    top: 80,
    left: 80,
  },
  footer: {
    position: 'absolute',
    bottom: 20,
  },
  neutronWording: {
    color: 'blue',
    fontSize: 18,
  },
});

export default NeutronAnimation;
